1	regulamin.html	Regulamin	! Rozdział I\r\n!! Postanowienia ogólne\r\n\r\n# Sieć Komputerowa Osiedla Studenckiego Politechniki Gdańskiej, zwana dalej SKOS PG, obejmuje swoim zasięgiem sieci LAN wszystkich domów studenckich i hoteli asystenckich Politechniki Gdańskiej zwanych dalej Osiedlem Studenckim i jest dołączona bezpośrednio do Trójmiejskiej Akademickiej Sieci Komputerowej zwanej dalej TASK.\r\n# Zadaniem sieci SKOS PG jest świadczenie usług na rzecz mieszkańców Osiedla Studenckiego, zwanych dalej użytkownikami, w zakresie: przesyłania i udostępniania danych, poczty elektronicznej, jak również innych usług wynikających z aktualnych możliwości techniczno-eksploatacyjnych sieci SKOS oraz innych sieci, z których zasobów sieć ta korzysta.\r\n# Sieć SKOS PG, jako jedna z sieci wchodzących w skład Uczelnianej Sieci Komputerowej Politechniki Gdańskiej – USK PG i jako podłączona do sieci TASK podlega przepisom zawartym w regulaminach tych sieci stanowiących integralną część niniejszego regulaminu, dostępnych sieciowo na stronach domowych Ośrodka Informatycznego PG i Centrum Informatycznego TASK zwanych dalej odpowiednio OI PG oraz CI TASK.\r\n# Struktura techniczno-kablowa sieci lokalnych w poszczególnych budynkach Osiedla Studenckiego powinna zapewnić każdemu mieszkańcowi możliwość korzystania z zasobów SKOS PG oraz innych sieci komputerowych.\r\n# Infrastruktura techniczno-kablowa lokalnych sieci komputerowych w poszczególnych Domach Studenckich stanowi majątek Osiedla Studenckiego, a w Hotelach Asystenckich Działu Socjalnego.\r\n# Interesy użytkowników SKOS PG reprezentowane są przez odpowiedni organ Samorządu Studenckiego zwany dalej SSPG, którego zadania, uprawnienia oraz inne sprawy organizacyjne ustalone są w odrębnym regulaminie. Regulamin ten jest tworzony przez Samorząd Studencki i zatwierdzany przez Prorektora ds. Kształcenia PG.\r\n# Sprawami techniczno-eksploatacyjnymi SKOS PG zajmuje się Administrator Centralny SKOS PG, zwany dalej administratorem centralnym,\r\n# Niniejszy regulamin zatwierdza Rektor Politechniki Gdańskiej na wniosek Prorektora ds. Kształcenia.\r\n\r\n! Rozdział II\r\n!! Użytkownicy - uprawnienia i obowiązki\r\n\r\n# Użytkownikiem może być każdy mieszkaniec Osiedla Studenckiego, mający techniczne możliwości podłączenia się do sieci. Mieszkaniec uzyskuje status Użytkownika SKOS PG zgodnie z pkt. 1 rozdz. IV niniejszego regulaminu.\r\n# Użytkownik może korzystać z zasobów sieci SKOS PG i innych sieci komputerowych pod warunkiem przestrzegania zasad określonych w niniejszym regulaminie, w regulaminach sieci PG i TASK, ogólnych zasad korzystania z sieci Internet oraz zasad współżycia społecznego zgodnych z obowiązującym porządkiem prawnym.\r\n# Użytkownik jest odpowiedzialny za pozostawanie w zgodzie z obowiązującymi przepisami w kwestii praw autorskich i umów licencyjnych. Dotyczy to zarówno danych i oprogramowania umieszczonego na komputerze będącym w jego posiadaniu jak i zawartości prywatnych kont oraz wspólnej przestrzeni dyskowej dostępnej na serwerach SKOS PG.\r\n# W ramach korzystania z zasobów SKOS PG użytkownikom zostaną udostępnione wszystkie usługi oferowane w sieci oraz mogą zostać przyznane im konta przeznaczone do indywidualnego użytku. Konta te nie mogą być udostępniane innym osobom lub wykorzystywane w sposób niezgodny z niniejszym regulaminem. Szczegółowe zasady, w tym zakresie, określa SSPG  w porozumieniu z administratorem centralnym.\r\n# Użytkownik zobowiązuje się nie wykorzystywać zasobów sieci niezgodnie z ich przeznaczeniem i nie wykonywać zabronionych działań, a w szczególności:\r\n## instalowania na komputerach użytkowników oprogramowania umożliwiającego dostęp do sieci z urządzeń nie posiadających zgody administratora lokalnego na podłączenie (oprogramowanie proxy, IP masquerading, NAT itp.) oraz podłączania takich urządzeń do komputera użytkownika (tworzenie własnych podsieci),\r\n## uruchamiania usług serwerowych na komputerach użytkowników a w szczególności: dns, dhcp, wins, proxy, poczta, ftp, www, dns, dhcp itp., \r\n## podszywania się pod innych użytkowników, monitorowania łącz lub skanowania portów,\r\n## atakowania sieci lub komputerów, celowego obciążania łącz, uniemożliwiania działania usług sieciowych, wysyłania spamu itp.\r\n# W szczególnie uzasadnionych przypadkach użytkownik może uzyskać specjalne zezwolenie na uruchomienie na swoim komputerze konkretnej usługi. Należy wówczas wystąpić z pisemnym wnioskiem do SSPG, który podejmie decyzję w porozumieniu z administratorem centralnym. Wniosek musi określać rodzaj usługi i czas jej trwania.\r\n# Zasady korzystania z usług sieciowych udostępnianych użytkownikom w ramach SKOS PG określa SSPG. Odpowiedzialność za treści merytoryczne pojawiające się w ramach usług udostępnianych za pomocą sieci SKOS PG ponosi użytkownik. W przypadku nie przestrzegania przez użytkowników zasad użytkowania zasobów sieci SKOS, SSPG podejmuje stosowne regulaminowe decyzje w sprawie takich użytkowników.\r\n# Użytkownicy mają obowiązek stosowania się do zaleceń administratorów w sprawach dotyczących bezpieczeństwa i efektywności eksploatacji komputerów w sieci, w szczególności stosować: \r\n## krytyczne aktualizacje systemów operacyjnych,\r\n## oprogramowanie antywirusowe.\r\n# Użytkownik zobowiązuje się do ochrony swoich zasobów poprzez stosowanie nietrywialnych haseł zabezpieczających, okresową ich zmianę oraz ochronę tych haseł przed osobami postronnymi.\r\n# Użytkownik zobowiązuje się, że będzie korzystał z usług zgodnie z wymogami wcześniej wymienionych regulaminów oraz że nie będzie wykorzystywał zasobów SKOS PG w celu prowadzenia jakiejkolwiek działalności komercyjnej lub niezgodnej z obowiązującym prawem.\r\n# Użytkownik zobowiązuje się do dbania we własnym zakresie o stan techniczny okablowania i urządzeń aktywnych znajdującego się w jego pokoju. Zabrania się dokonywania jakichkolwiek zmian w strukturze sieci bez zezwolenia administratora lokalnego.\r\n# Użytkownik wyraża zgodę na udostępnienie swoich danych osobowych władzom Politechniki Gdańskiej dla potrzeb eksploatacji SKOS PG. Dane te mogą zostać udostępnione na wniosek organów ścigania oraz na pisemny, uzasadniony wniosek SSPG.\r\n# Użytkownik naruszający niniejszy regulamin może zostać pozbawiony okresowo lub całkowicie możliwości korzystania z sieci bez zwrotu wniesionych opłat.\r\n# Użytkownik sieci może odwołać się w ciągu 14 dni od decyzji administratora lokalnego lub osiedlowego do SSPG, który rozstrzyga sprawę w porozumieniu z administratorem centralnym. Od decyzji SSPG przysługuje prawo odwołania do Prorektora ds. Kształcenia PG.\r\n\r\n! Rozdział III\r\n!! Administrowanie SKOS PG\r\n\r\n# Nadzór nad funkcjonowaniem SKOS PG na styku z sieciami USK PG i TASK, opiniowanie projektów technicznych związanych z rozbudową SKOS PG i udział w odbiorach technicznych z tym związanych wykonuje koordynator SKOS PG z ramienia USK PG, zwany dalej koordynatorem.\r\n# Administrowanie zasobami SKOS PG odbywa się na następujących poziomach uprawnień i odpowiedzialności:\r\n## administratorzy centralni SKOS PG, zwani dalej administratorami centralnymi,\r\n## administratorzy osiedlowi SKOS PG, zwani dalej administratorami osiedlowymi,\r\n## administratorzy lokalni SKOS PG, zwani dalej administratorami lokalnymi.\r\nKoordynatorem i administratorami centralnymi (pkt. 1 i 2a) są osoby zatrudnione w Ośrodku Informatycznym PG w łącznym wymiarze jednego etatu, który finansowany jest z funduszy Osiedla Studenckiego.\r\n\r\nAdministratorami osiedlowymi (pkt. 2.b) oraz lokalnymi (pkt. 2.c) mogą być wyłącznie uprawnieni mieszkańcy Osiedla Studenckiego.\r\nOsoba, której powierzono funkcje administratora lokalnego i (lub) osiedlowego pełni swoje obowiązki do czasu odwołania lub rezygnacji. \r\n\r\n# Podstawowe zadania osób pełniących funkcje koordynatora i administratorów centralnych:\r\n## współpraca z administratorami USK PG i CI TASK w zakresie bezpieczeństwa oraz innych zagadnień mających wpływ na poprawne działanie sieci,\r\n## pełnienie nadzoru nad poprawnością i ciągłością działania infrastruktury sieci i usług oferowanych przez SKOS PG oraz współpraca w tym zakresie z administratorami niższego szczebla,\r\n## podejmowanie decyzji o uruchamianiu usług do celów administracji SKOS PG,\r\n## nadzór nad konfiguracją sprzętową i programową serwerów oraz urządzeń sieciowych SKOS PG,\r\n## kontrola realizacji zadań dotyczących administrowania zasobami SKOS PG powierzonych do wykonywania administratorom niższego szczebla,\r\n## udział w przygotowaniach planów rozwoju SKOS PG,\r\n## udział w odbiorach technicznych oraz we wdrażaniu do eksploatacji zakupionego sprzętu i oprogramowania,\r\n## przygotowywanie zakresu rzeczowego zakupów w porozumieniu z administratorami osiedlowymi i lokalnymi,\r\n## gromadzenie i nadzór nad dokumentacją związaną z eksploatacją sieci i urządzeń wchodzących w jej skład,\r\n## posiadanie pełnej wiedzy na temat konfiguracji i oprogramowania zainstalowanego na serwerach i urządzeniach sieciowych SKOS PG,\r\n## ustalanie zakresu uprawnień i wybór administratorów lokalnych w porozumieniu z administratorami osiedlowymi,\r\n## przedstawienie wniosków do planów zakupowych dotyczących rozwoju i bieżącej eksploatacji SKOS PG,\r\n## ustalenie rodzaju i zawartości dokumentacji prowadzonej przez administratorów osiedlowych oraz administratorów lokalnych,\r\n## ustalanie zadań szczegółowych dla administratorów osiedlowych,\r\n## powoływanie grup roboczych do prowadzenia określonych zagadnień związanych z funkcjonowaniem i rozbudową SKOS PG,\r\n## wnioskowanie i opiniowanie w sprawach związanych z regulaminem SKOS PG,\r\n## opiniowanie w sprawach dotyczących opłat za dostęp do zasobów SKOS PG,\r\n\r\nZa niewypełnienie powierzonych obowiązków lub działania sprzeczne z niniejszym regulaminem koordynator i administratorzy centralni ponoszą odpowiedzialność służbową. Uwagi w tych sprawach Kierownik Osiedla Studenckiego kieruje do dyrektora Ośrodka Informatycznego PG.\r\n\r\n# Administratorzy osiedlowi są reprezentantami poszczególnych sieci Osiedla Studenckiego (po jednym na: Osiedle Traugutta i Osiedle Wyspiańskiego + Brzeźno + Jelitkowo). Wybierani są corocznie zwykłą większością głosów przez administratorów lokalnych danej części Osiedla spośród siebie. Podstawowe zadania:\r\n## współpraca z administratorami lokalnymi oraz koordynatorem i administratorami centralnymi w zakresie reprezentowanej części Osiedla Studenckiego,\r\n## nadzór nad działalnością administratorów lokalnych i w ramach tego całodobowy dostęp do urządzeń sieciowych w poszczególnych budynkach Osiedla,\r\n## realizacja zadań szczegółowych, powierzonych na piśmie, przez administratorów centralnych, a dotyczących administrowania częścią sieci SKOS PG oraz serwerami tej sieci,\r\n## uczestnictwo w odbiorach technicznych infrastruktury SKOS PG,\r\n## pełnienie funkcji administratora lokalnego,\r\n## przydzielanie administratorom lokalnym zadań związanych z administracją serwerami i usługami SKOS PG,\r\n## przedstawianie rocznego sprawozdania z własnej działalności pod koniec każdego roku kalendarzowego. Sprawozdanie to podlega przyjęciu przez administratora centralnego. Jest to podstawą do kontynuowania pełnienia obowiązków w następnym roku akademickim.\r\n## Administratorzy lokalni reprezentują poszczególne budynki Osiedla Studenckiego. Liczbę administratorów lokalnych w okresie roku akademickiego ustala się na: po jednym w: DS-5Ł, DS-12, HA-2, po czterech w: DS-2, DS-8, po dwóch w pozostałych akademikach. W okresie wakacyjnym liczbę administratorów lokalnych ustala się na: trzech na Osiedlu po stronie ul. Traugutta, trzech na Osiedlu po stronie ul. Wyspiańskiego.\r\n\r\nWyboru administratorów lokalnych dokonuje się w sposób następujący:\r\n# imienne propozycje przedstawiają administratorzy osiedlowi,\r\n# SSPG opiniuje każdą z kandydatur, w terminie nie dłuższym niż dwa tygodnie od dnia wpłynięcia stosownego pisma; brak opinii w wyznaczonym terminie uznaje się jako akceptację zgłaszanej kandydatury,\r\n# kandydatury akceptuje administrator centralny po przeprowadzeniu rozmów z wytypowanymi osobami,\r\n# wybór zatwierdza Prorektor ds. Kształcenia.\r\n\r\nAdministrator centralny informuje administratorów osiedlowych, SSPG oraz kierownika Osiedla Studenckiego o wyborze administratorów lokalnych.\r\nJeżeli administrator lokalny wybrany na stanowisko administratora osiedlowego nie może pełnić tych funkcji jednocześnie to w domu studenckim (hotelu), z którego wywodzi się ta osoba, dokonuje się wyboru uzupełniającego na stanowisko administratora lokalnego. Wybory uzupełniające administratorów lokalnych i osiedlowych organizuje administrator centralny.\r\nPełnienie jednocześnie funkcji administratora lokalnego i administratora osiedlowego nie powoduje zwiększenia wynagrodzenia o którym mowa w pkt. 7 tego rozdziału.\r\nPodstawowe zadania administratorów lokalnych:\r\n\r\n# współpraca z administratorami lokalnymi i osiedlowymi oraz administratorem centralnym,\r\n# bezpośredni nadzór techniczny i administracyjny nad urządzeniami będącymi na wyposażeniu sieci lokalnej, przy zapewnieniu całodobowego dostępu do tych urządzeń,\r\n# zgłaszanie kradzieży i fizycznych usterek sieci do administracji domu studenckiego, a awarii sprzętu sieciowego do odpowiedniego administratora osiedlowego i administratora centralnego,\r\n# rejestracja wszystkich komputerów sieci lokalnej w wyznaczonych domenach i przydzielanie adresów IP,\r\n# prowadzenie rejestrów użytkowników o treści uzgodnionej z administratorem centralnym,\r\n# zapobieganie dostępowi do sieci nie zarejestrowanych komputerów,\r\n# zapobieganie uruchamianiu przez użytkowników niedozwolonych usług,\r\n# udzielanie użytkownikom informacji o właściwej konfiguracji stacji roboczych umożliwiającej korzystanie z SKOS PG oraz o zasadach korzystania z zasobów SKOS PG,\r\n# przedstawianie rocznego sprawozdania z działalności pod koniec każdego roku akademickiego, nie później niż do pierwszego zebrania w następnym roku akademickim. Sprawozdanie to podlega przyjęciu przez administratorów osiedlowych. Jest to podstawą do kontynuowania pełnienia obowiązków w następnym roku akademickim.\r\n# Niewypełnienie przez administratorów lokalnych lub osiedlowych powierzonych obowiązków, negatywna ocena corocznego sprawozdania lub działania sprzeczne z regulaminem mogą być podstawą do odwołania z pełnionej funkcji i wymierzenia kary przewidzianej niniejszym regulaminem. Decyzję o odwołaniu podejmuje Prorektor ds. Kształcenia na wniosek:\r\n## administratora centralnego,\r\n## SSPG,\r\n## Prorektora ds. Kształcenia .\r\n## Wnioski powinny być zaopiniowane przez administratora centralnego.\r\n# Administratorom lokalnym i osiedlowym, zatwierdzonym przez Prorektora ds. Kształcenia, przysługuje wynagrodzenie w formie umów zlecenia. Stawkę miesięczną wynagrodzenia za pełnienie funkcji administratorów osiedlowych i lokalnych ustala każdego roku w grudniu na rok następny Prorektor ds. Kształcenia w oparciu o propozycje Kierownika Osiedla uzgodnioną z administratorem centralnym  i  SSPG.\r\n\r\nUmowy z administratorami osiedlowymi i lokalnymi zawiera Kierownik Osiedla z terminami wypłat w miesiącach czerwiec (za m-ce od stycznia do czerwca) i grudzień (za m-ce od października do grudnia) każdego roku. Wykonanie zadań potwierdza administrator centralny. Za pełnienie funkcji administratora osiedlowego i lokalnego w okresie wakacji przysługuje wynagrodzenie jak wyżej, wypłacane w miesiącu październiku (za m-ce od lipca do września).\r\n\r\n! Rozdział IV\r\n!! Rejestracja Użytkowników i podłączanie komputerów w SKOS PG\r\n\r\n# Użytkownikiem SKOS PG staje się mieszkaniec Osiedla Studenckiego po dokonaniu rejestracji komputera podłączonego do SKOS PG lub przyznaniu konta na serwerach SKOS PG.\r\n# Do sieci SKOS PG mogą być podłączane komputery:\r\n## będące w posiadaniu mieszkańców Osiedla Studenckiego,\r\n## ogólnodostępne, będące na wyposażeniu poszczególnych budynków Osiedla Studenckiego,\r\n## będące w posiadaniu administracji w poszczególnych budynkach Osiedla Studenckiego,\r\n## będące w posiadaniu innych pracowników PG zamieszkujących w Osiedlu Studenckim, mających pozwolenie SSPG.\r\n# Do sieci SKOS PG nie mogą być podłączone komputery:\r\n## wykorzystywane do działalności komercyjnej,\r\n## osób, nie związanych z procesem dydaktycznym, nie posiadających pisemnej zgody SSPG.\r\n# Liczba komputerów podłączanych do sieci ograniczona jest fizycznym dostępem do sieci (liczba czynnych gniazd) oraz liczbą adresów IP.\r\n# Komputer podłączany do sieci musi być zarejestrowany w domenie pierwotnej i odwrotnej przydzielonej poszczególnym budynkom Osiedla Studenckiego. Zabronione jest rejestrowanie komputerów w innych domenach.\r\n# Komputer może być podłączony do sieci za zgodą administratora lokalnego po uprzednim wypełnieniu formularza rejestracyjnego. Podanie nieprawdziwych danych rejestracyjnych stanowi naruszenie postanowień niniejszego regulaminu. Zabrania się samodzielnego podłączania do sieci komputerów lub innych urządzeń.\r\n# Komputer podłączany do sieci powinien być sprawny technicznie, skonfigurowany zgodnie z zaleceniami administratora lokalnego. \r\n# Rejestracja traci ważność z końcem roku akademickiego, w którym została dokonana. W przypadku Hotelu Asystenckiego rejestracja traci ważność w momencie wygaśnięcia umowy o zamieszkanie.\r\n\r\n! Rozdział V\r\n!! Finansowanie i odpłatność w SKOS PG\r\n\r\n# Koszty utrzymania i rozbudowy zasobów SKOS PG pokrywane są z:\r\n## funduszu pomocy materialnej dla studentów,\r\n## dochodów własnych Osiedla Studenckiego, w tym z wpłat użytkowników,\r\n## innych środków, w tym z funduszu rozwoju uczelni.\r\n# Odpłatność za możliwość korzystania z SKOS PG na dany rok kalendarzowy ustalana jest do 30 grudnia poprzedniego roku kalendarzowego. Stanowi ona część opłaty za miejsce w budynku dołączonym do SKOS PG i jest stała nawet przy zmianie innych opłat. Kwota odpłatności na kolejny rok kalendarzowy jest ustalona na wniosek:\r\n## Kierownictwa Osiedla Studenckiego,\r\n## SSPG, po zaciągnięciu opinii administratora centralnego.\r\n\r\nWnioski należy składać do 1 grudnia bieżącego roku w Biurze Osiedla Studenckiego z równoczesnym powiadomieniem zainteresowanych stron. Brak wniosków oznacza, że aktualna stawka odpłatności obowiązuje w następnym roku kalendarzowym.\r\nW przypadku wpłynięcia wniosków, kwota odpłatności ustalana jest przez Kierownictwo Osiedla Studenckiego w porozumieniu z administratorem centralnym i SSPG, a następnie zatwierdzana przez Prorektora ds. Kształcenia.\r\n\r\n# W okresie wakacyjnym odpłatność za korzystanie z SKOS PG naliczana jest w formie ryczałtu w wysokości corocznie ustalanej przez kierownictwo Osiedla Studenckiego w porozumieniu z administratorem centralnym i SSPG. Ryczałt ten jest ustalany na podstawie ilości zamieszkałych studentów PG i doktorantów w okresie "Akcji Lato" w roku poprzednim.\r\n# Odpłatność użytkowników za korzystanie z sieci, stanowiąca dochody własne Osiedla Studenckiego, przeznaczona jest w całości na:\r\n## pokrycie kosztów przyłączy SKOS PG do sieci MAN - TASK,\r\n## pokrycie kosztów administrowania zasobami SKOS PG,\r\n## na zakupy inwestycyjne i modernizację sieci realizowane z funduszu rozwoju Uczelni,\r\n# Kierownictwo Osiedla Studenckiego przedstawia corocznie SSPG i administratorowi centralnemu:\r\n## sprawozdanie finansowe za ubiegły rok kalendarzowy w zakresie środków pochodzących z wpłat użytkowników oraz poniesionych kosztów na rozbudowę i utrzymanie SKOS PG – do dnia 15 lutego,\r\n## oszacowanie przychodów SKOS PG w roku bieżącym – do 15 stycznia.\r\n# Koordynator i administrator centralny w porozumieniu z administratorami osiedlowymi przygotowuje, do końca lutego bieżącego roku, plan wydatków inwestycyjnych i bieżących, który po zaakceptowaniu przez SSPG przekazuje do kierownika Osiedla Studenckiego oraz do dyrektora Ośrodka Informatycznego w terminie do 15 marca bieżącego roku. Ewentualne korekty planu zostają przedstawiane SSPG do ponownych uzgodnień. Prace i uzgodnienia związane z tworzeniem planu wydatków inwestycyjnych i bieżących muszą być zakończone do 31 marca każdego roku.\r\n\r\n! Rozdział VI\r\n!! Postanowienia końcowe\r\n\r\n# Poważne naruszenie postanowień niniejszego regulaminu będzie karane na drodze dyscyplinarnej.\r\n# Sprawy sporne pomiędzy użytkownikami, a administratorami lokalnymi lub osiedlowymi rozstrzyga administrator centralny. Ostateczną instancją odwoławczą jest Prorektor ds. Kształcenia po zaciągnięciu opinii SSPG.\r\n# Zmiany do niniejszego regulaminu, kierowane są do Prorektora ds. Kształcenia i mogą być wnioskowane przez:\r\n## SSPG,\r\n## Kierownictwo Osiedla,\r\n## administratora centralnego.\r\n\r\nWszyscy uprawnieni do wnioskowania muszą być powiadomieni o proponowanych zmianach.\r\n\r\n# Regulamin podlega publicznemu ogłoszeniu w Osiedlu Studenckim.\r\n# Każdy użytkownik SKOS potwierdza zapoznanie się z niniejszym regulaminem (wraz z załącznikami) podpisem w rejestrze prowadzonym przez odpowiedniego administratora lokalnego.\r\n# Nieznajomość niniejszego regulaminu, jak również regulaminów USK PG i TASK, nie zwalnia użytkowników z ich przestrzegania.\r\n# Niniejszy regulamin wchodzi w życie z dniem ogłoszenia.\r\n\r\n **Regulamin został podpisany przez Prorektora 23.05.2005**	2007-10-23 20:12:12	\N
