3	wiki.html	Składnia	! Nagłówek\r\n!! Nagłówek\r\n!!! Nagłówek\r\n!!!! Nagłówek\r\n!!!!! Nagłówek\r\n!!!!!! Nagłówek\r\n\r\nParagraf pierwszy: [[http://wp.pl/ link|Wirtualna Polska]] albo [https://sru.ds.pg.gda.pl/2004/images/godlo.gif logo PG|Politechnika Gdańska]. W razie potrzeby można escape'ować znaki specjalne za pomocą \\\\ - np. \\[to nie jest obrazek].\r\n\r\nParagraf drugi z wyróżnieniami: *słabym* i **mocnym**\r\n\r\nParagraf trzeci: ^supskrypt^, _subskrypt_ oraz krótko-długie - myślniki --- .\r\n\r\nSą też "polskie cydzysłowy" i ,,cytaty inline''.\r\n\r\nJak widać, brakuje jeszcze tabelek i nie wszystko jest estetycznie ostylowane, ale to szczegół.\r\n\r\n----\r\n\r\n* Lista\r\n** Lista\r\n** Lista\r\n* Lista\r\n# Lista\r\n## Lista\r\n\r\n>Cytat blokowy\r\n>\r\n>Może mieć wiele paragrafów\r\n>*Listy\r\n>>I inne cytaty lokowe\r\n\r\n----\r\n\r\nSą też różne inne zaawansowane rzeczy, ale chyba nie będą nam potrzebne. Np. filmy z [[http://youtube.com/ YouTube]]:\r\n\r\n@y:1qiGyxPplAw	2007-10-22 16:19:23	\N
4	ufra.html	Framework	! Krótki opis frameworka UFra\r\n\r\n..ctl\r\n!! Kontroler (ctl)\r\n\r\nParsuje URL i na jego podstawie ustawia zmienne w \\_GET, które są dostępne w dalszych częściach aplikacji. W tym miejscu może nastąpić uruchomienie innego kontrolera. W przypadku aplikacji wielomodułowej działanie frontcontrollera ogranicza się do uruchamiania głównych kontrolerów poszczególnych modułów.\r\n\r\nWybiera i uruchamia [[#act akcję]] oraz [[#view widok]] na podstawie requestu i [[#acl uprawnień]]. Złapanie wyjątku UFex\\_Core\\_ViewChange powoduje ponowne wybranie widoku - daje to możliwość "przekierowania" na inny widok przez dowolną warstwę aplikacji.\r\n\r\nDostępne są trzy filtry - przed wyborem akcji, pomiędzy akcją a wyborem widoku oraz końcowy - po uruchomieniu widoku.\r\n\r\n..view\r\n!! Widok (view)\r\n\r\nPrzyporządkowuje boksy do poszczególnych części strony. Taka konstrukcja umożliwia łatwe użycie tego samego boksa na różnych stronach bądź w różnych jej częściach.\r\n\r\n..box\r\n!! Boks (box)\r\n\r\nPobiera dane i następnie przekazuje je do wyświetlenia przez [[#tpl szablon]]. Jeżeli jakaś metoda (wywoływana w [[#view widoku]]) nie jest zaimplementowana, to automatycznie jest uruchamiana taka sama metoda z szablonu - statyczne boksy definiuje się tylko w szablonie.\r\n\r\n..bean\r\n!! Obiekt danych (bean)\r\n\r\n!!! Listy\r\n\r\nDziedziczą po UFbeanList - pobierają i przechowują listę danych, umożliwiają jedynie ich wypisywanie. Mają zaimplementowany ArrayAccess oraz Iterator, czyli można ich używać, jak zwykłych tablic.\r\n\r\nNiezaimplementowane metody rozpoczynające się na "list" są automatycznie uruchamiane z [[#dao obiektu dostępu do danych]].\r\n\r\n!!! Pojedyncze dane\r\n\r\nDziedziczą po UFbeanSingle - pobierają, przechowują, zapisują, sprawdzają poprawność poszczególnych pół oraz wypisują dane pojedynczego elementu.\r\n\r\nNiezaimplementowane metody rozpoczynające się na "get" są automatycznie uruchamiane z obiektu dostępu do danych.\r\n\r\n..dao\r\n!! Dostęp do danych (dao)\r\n\r\nOdpowiadają za dostęp do danych oraz sprawdzanie ich poprawności i rzutowanie na PHP-owe typy. Działają na podstawie informacji zawartych w [[#map mapowaniach]]. Metody w [[#bean beanach]] są najczęściej "nakładkami" na te z DAO.\r\n\r\n..map\r\n!! Mapowanie (map)\r\n\r\nŁączy pola w [[#bean beanie]] z bazodanowymi (w dowolnych tabelach). Teoretycznie umożliwia zmianę struktury bazy bez modyfikacji innych warstw aplikacji, ale bywają wyjątki od tej zasady.\r\n\r\nStandardowo są używane:\r\n* list - do pobierania listy elementów\r\n* get - do pobiernia pojedynczego elementu\r\n* set - do modyfikacji\r\n* add - do dodawanie nowego elementu\r\n* del - do usuwania\r\n\r\n..act\r\n!! Akcja (act)\r\n\r\nModyfikuje dane lub dokonuje innych działań. Sygnalizuje zaistnienie błędów, bądź poprawne wykonanie akcji.\r\n\r\n..acl\r\n!! Uprawnienia (acl)\r\n\r\nInformuje o posiadaniu, bądź nie, uprawnień do elementów i funkcjonalności.\r\n\r\n..tpl\r\n!! Szablon (tpl)\r\n\r\nZwraca sformatowane dane. Są trzy warstwy szablonów: [[#view widoku]], [[#box boksu]] i [[#bean beana]].	2007-10-23 15:02:32.212773	\N
